import {styled} from "styled-components"

export const DepositPageContainer = styled.div`
    display: flex;
	flex-direction: column;
    margin: 50px 0;
`

export const DepositContainer = styled.div`
    width: 850px;
    display: flex;
    justify-content: space-between;
    margin: 30px auto;
`
